import React, { Component } from 'react';

import {
  Column,
  Columns,
  Level,
  LevelLeft,
  LevelRight
} from 'bloomer';

import { ReactComponent as SvgDraw } from '../../assets/undraw_booking_33fn.svg';

class AppointmentCreation extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return(
      <React.Fragment>
        <Columns>
          <Column isSize={ 6 }>
          </Column>
          <Column isSize={ 6 }>
            <SvgDraw style={{ height: '500px', width: '500px' }}/>
          </Column>
        </Columns>
      </React.Fragment> )
  }
}

export default AppointmentCreation;
